(641, 1, 1, 5, 13, 102, 11, 3, '2023-05-08 11:51:07', '2023-05-08 11:51:07', 1, '00930068297', 'JACYARA SILVA BRAZAO ', 'NãO', 'TRAVESSA FORTUNATO PERIS 827 BURITIZAL ', '96984052885', 'A Sra. Jacyara casou-se e alterou seu nome de solteira, razão pela qual, requereu a alteração de seu nome na certidão de nascimento do filho.\r\nAssim, a requerente foi encaminha ao Cartório para que fossem dadas as providências cabíveis à presente demanda.', '', 0, 1, NULL, NULL),
(642, 7, 1, 5, 13, 102, 11, 3, '2023-05-08 11:54:49', '2023-05-08 11:54:49', 1, '06172605240', 'RAIANE ESTéFANE DOS SANTOS CRUZ ', 'NãO', 'PASSAGEM 13 DE SETEMBRO 54/ BURITIZAL ', '96981011738', 'A assistida compareceu em atendimento o mutirão para informar que a data do seu nascimento consta como errada na segunda via, é necessário que se faça pesquisa no CRC, porque na primeira via está correta, conforme consta em anexo.\r\nA mesma informou que à dois anos teve sua identidade roubada e não conseguiu tirar em virtude de ter um furo no nome do pai e agora que possui a nova via, o ano do nascimento está errado, pois a parte nasceu em 2002, mas na 2ª via consta como 2004, por isso se faz necessário a correção da data.\r\nRAIANE ESTEFANE DOS SANTOS CRUZ\r\n\r\nCONTATO: 96 98101-1738\r\n\r\nCPF: 061.726.052-40\r\n\r\nPROFISSÃO: DO LAR\r\n\r\nNÃO RECEBE BENEFICIO SOCIAL\r\n\r\nENDEREÇO: Passagem 13 de Setembro, Nº 54', '', 0, 1, NULL, NULL),
(643, 7, 1, 5, 13, 102, 11, 3, '2023-05-08 11:57:18', '2023-05-08 11:57:18', 1, '22601759291', 'MATILDE DOS SANTOS COSTA ', 'NãO', 'RUA RAUL MONTEIRO MONTêS 1831 B / BURITIZAL ', '96999149053', 'MATILDE DOS SANTOS COSTA, brasileira, casada, desempregada, portadora do CPF nº 226.017.592-91 e RG nº 740478, residente e domiciliada na Rua Raul Monteiro Valdez, nº 1831 B, Macapá/AP, telefone: 96999149053 (somente ligação) e 96991370857 (Daimara, filha).\r\nDOS FATOS:\r\nA assistida informou que a mãe dela emitiu a segunda via  da sua certidão de nascimento em Breves/PA, por meio da qual emitiu a primeira via do seu RG.\r\nOcorre que, em fevereiro de 2023, foi ao Superfácil para conseguir a segunda via do seu RG, quando foi informada que o número de matrícula da sua certidão constava erro, mas não sabe informar exatamente qual o erro do número.\r\nAssim, foi ao cartório para tentar resolver o erro, quando foi emitida uma nova certidão com o número de matrícula completamente diferente, além disso, não consta a informação do seu local de nascimento.\r\nAlém disso, a requerente também pretende conseguir a segunda via do seu RG, que só poderá ser emitido após a regularização da sua certidão de nascimento\r\nConforme orientação do Defensor Rodrigo, deverá ser feita requisição via CRC e, posteriormente, enviado ofício à POLITEC para emissão de segunda via do RG.', '', 0, 1, NULL, NULL),
