(647, 1, 1, 5, 13, 102, 11, 3, '2023-05-08 12:12:04', '2023-05-08 12:12:04', 1, '84307226291', 'ANA BRASIL PEREIRA', 'NãO', 'AVENIDA FELIPE CAMARãO, 1016B,BURITIZAL', '984138505', 'CLARISSE DE DEUS PEREIRA CAMPOS (RL: ANA BRASIL PEREIRA)\r\nFalei com: Ana Brasil Pereira\r\nTelefone: 96984138505 (whatsapp)\r\nDADOS\r\nCLARISSE DE DEUS PEREIRA CAMPOS, brasileira, portadora do CPF nº 056.648.662-84, nascida em 16/01/2013, representada pela genitora ANA BRASIL PEREIRA, brasileira, divorciada, desempregada, portadora do RG nº 686087 e CPF nº 843.072.262-91, telefone (96)98413-8505 (whatsapp);\r\n\r\nDOS FATOS\r\n\r\nA sra Ana informou que foi ao Superfácil emitir o RG da filha CLARISSE DE DEUS PEREIRA CAMPOS, quando foi informada que consta erro no número de matrícula na certidão, uma vez que não deveria ter letras no número de matrícula.\r\n\r\nEm razão desse erro, não pode emitir o RG da filha.\r\n\r\nAlém disso, consta na certidão de nascimento da filha o nome de casa (Ana Pereira Pinto), entretanto, a mãe está divorciada e requer que seja alterado o seu nome para que passe a constar seu nome de solteira.\r\n\r\nAssim, pleiteia a retificação do número de matrícula da certidão de nascimento de Clarisse de Deus Pereira e a retificação do nome da genitora para que passe a constar o nome de solteira ANA BRASIL PEREIRA.\r\n\r\n\r\n\r\nDOCUMENTOS PENDENTES\r\n\r\nA requerente se comprometeu a entregar sua certidão de nascimento constatando que encontra-se divorciada', '', 0, 1, NULL, NULL),
(648, 1, 1, 5, 13, 102, 11, 3, '2023-05-08 12:14:17', '2023-05-08 12:14:17', 1, '03083248202', 'MARIA NEOCIONITA MONTEIRO SOUZA ', 'NãO', 'AVENIDA RAIMUNDO PERES 1025/ ZERãO ', '93984344225', 'MARIA NECIONITA (atendimento feito por Rodrigo)\r\nAssistida quer segunda via do RG. Ocorre que, na matrícula dela, constam dois dígitos “XX” que não foram reconhecidos no Super Fácil. Vou solicitar segunda via do CRC.', '', 0, 1, NULL, NULL),
